r($,"aGW","ajn",()=>A.a([A.wq("Against the background of the development and introduction of flat-rate reimbursement systems in the acute sector (DRGs), work has been going on in Germany for around 15 years to develop case grouping systems for medical rehabilitation. The concept of rehabilitant management categories (RMK) developed at the Charite classifies rehabilitants primarily according to the rehabilitation-relevant limitations of activity and participation, since these determine the need for treatment and the use of resources in rehabilitation.","RMK - Project"),A.wq("A cleaning application is a mobile or web-based application that allows users to schedule and manage professional cleaning services for their homes or offices. These applications typically connect users with local cleaning companies or independent contractors who can provide the services they need.","NC-Cleaner"),A.wq("Catamnesis is a Greek word that refers to the process of evaluating a patient's history, symptoms, and treatment outcomes over time. Patient catamnesis is the process of gathering and documenting information about a patient's health history, symptoms, treatments, and outcomes over an extended period of time. This process is typically carried out by a healthcare professional, such as a physician, nurse or therapist, and is an essential part of patient care and management. It is used to assess the patient's progress, identify any changes in their condition, and make decisions about further treatment or management.","Catamnesis"),A.wq("A corona test center is a facility that is set up specifically to test individuals for the presence of the coronavirus (SARS-CoV-2) which causes COVID-19. These centers typically offer a variety of testing options, including PCR tests, antigen tests, and antibody tests.","Corona-Testcenter"),A.wq("Kotlin is a programming language that runs on the Java Virtual Machine (JVM) and can be used to develop Android apps. In order to integrate a Kotlin SDK (Software Development Kit) into an Android app, you will need to first make sure that you have the latest version of the Kotlin plugin installed in your Android Studio.","SMS Integration into Kotlin SDK from Bryter.io"),A.wq("A summary of the follow-up, only a few questions are asked of the patient to keep track of the general assessment of smoking and alcohol consumption.","Catamnesis Light")],A.a2("w<He>")))
s($,"aGX","ary",()=>A.a([A.ahb("Bubble.io","Payment Stripe implementation","Bubble is a visual programming platform that allows users to build web and mobile applications without writing code. To implement Stripe, a payment processing platform, into a Bubble application, you will need to use Bubble's built-in Stripe plugin and connect it to your Stripe account. Once connected, you can use the plugin's actions and conditions to create payment forms, process payments, and handle payment events within your Bubble application. Additionally, you may also need to do some setup on the Stripe dashboard to configure webhooks and other settings related to your integration."),A.ahb("FlutterFlow.io","Learning FlutterFlow with Firebase","FlutterFlow is a low-code development platform that allows users to build mobile and web applications without writing code. It utilizes a drag-and-drop interface and pre-built components to make the development process faster and more accessible for non-technical users.FlutterFlow also allows for integration with various third-party services including Stripe for payment processing. Users can also use the platform to build custom integrations using webhooks, APIs, and other tools.Users can also use features like analytics, A/B testing, push notifications, and more to improve the user experience and increase engagement. With its visual editor, users can design their UI with ease and also preview their app on different devices."),A.ahb("Flutter","Increase Developer skills","Flutter is an open-source, cross-platform mobile application development framework created by Google. It uses the Dart programming language and allows for the creation of high-performance, visually attractive apps for iOS and Android, as well as for web and desktop. One of the key features of Flutter is its reactive programming model, which allows for the easy creation of responsive and animated UIs. It also has a rich set of pre-designed widgets, including Material Design and Cupertino, which can be customized to fit the look and feel of the app. Additionally, Flutter has Hot Reload feature that allows developers to see the changes they made in the code instantly in the app without the need to rebuild the entire app. Flutter also has a growing ecosystem and community, with many packages and plugins available to extend its functionality and make development even more efficient. Flutter is widely used by developers to build high-performance apps, games, and other applications across different platforms with a single codebase, making it a popular choice among developers.")],A.a2("w<Hm>")))
